import React from "React";
import Link from "next/link";
import Head from "next/head";
import axios from "axios";

function HomePage(props) {
  return (
    <React.Fragment>
      <Head>
        <title> Binance Web</title>
        <link rel="stylesheet" href="https://bootswatch.com/4/flatly/bootstrap.min.css"></link>
      </Head>
      <div>
        <h1>Binance Articles</h1>
        {props.pages.map(page => (
          <div>
            <Link key={page.id} href="/page" as={page.slug}>
              <a>{page.title}</a>
            </Link>
          </div>
        ))}
      </div>
    </React.Fragment>
  );
}

HomePage.getInitialProps = async () => {
  const res = await axios.get("https://binance-api-example.herokuapp.com/");
  return { pages: res.data };
};

export default HomePage;
